import React from 'react';

const DilemmaDisplay = ({ dilemma }) => {
  if (!dilemma) {
    return null;
  }

  return (
    <div className="dilemma-container">
      <h3>Dilemma</h3>
      <p className="dilemma-text">{dilemma}</p>
    </div>
  );
};

export default DilemmaDisplay;
